PRAGMA foreign_keys = ON;

CREATE TABLE bows( bow TEXT NOT NULL PRIMARY KEY );

CREATE TABLE measures( measure TEXT NOT NULL PRIMARY KEY );

CREATE TABLE venues( venue TEXT NOT NULL PRIMARY KEY );

CREATE TABLE faces( face TEXT NOT NULL PRIMARY KEY );

-- not yet in use
CREATE TABLE measure_faces (
    measure TEXT NOT NULL,
    face TEXT NOT NULL,
    PRIMARY KEY (measure, face),
    FOREIGN KEY (face) REFERENCES faces(face), 
    FOREIGN KEY (measure) REFERENCES measures(measure)
);


-- not yet in use
CREATE TABLE measure_distances (
    measure TEXT NOT NULL,
    face TEXT NOT NULL,
    distance INTEGER NOT NULL,
    PRIMARY KEY (measure, face, distance),
    FOREIGN KEY (measure, face) REFERENCES measure_faces(measure, face)
);

CREATE TABLE genders( gender TEXT NOT NULL PRIMARY KEY );

CREATE TABLE age_groups(
    age_group TEXT NOT NULL,
    display_order INTEGER NOT NULL,
    PRIMARY KEY (age_group),
    UNIQUE (display_order)
);

CREATE TABLE scorings(
    scoring TEXT NOT NULL,
    max_score INTEGER NOT NULL,
    PRIMARY KEY (scoring)
);

CREATE TABLE round_family (
    name TEXT NOT NULL,
    scoring TEXT NOT NULL,
    venue TEXT NOT NULL,
    measure TEXT NOT NULL,
    PRIMARY KEY (name),
    FOREIGN KEY (scoring) REFERENCES scorings,
    FOREIGN KEY (venue) REFERENCES venues,
    FOREIGN KEY (measure) REFERENCES measures
);


CREATE TABLE round (
    name TEXT NOT NULL,
    family_name TEXT NOT NULL,
    display_order INTEGER NOT NULL,
    PRIMARY KEY (name),
    FOREIGN KEY (family_name) REFERENCES round_family(name)
    UNIQUE (family_name, display_order)
);


CREATE TABLE arrow_count (
    family_name TEXT NOT NULL,
    distance_number INTEGER NOT NULL,
    num_arrows INTEGER NOT NULL,
    face TEXT NOT NULL,
    PRIMARY KEY (family_name, distance_number),
    FOREIGN KEY (family_name) REFERENCES round_family(name),
    FOREIGN KEY (face) REFERENCES faces
);


CREATE TABLE distance (
    round_name TEXT NOT NULL,
    distance_number TEXT NOT NULL,
    distance INTEGER NOT NULL,
    PRIMARY KEY (round_name, distance_number),
    FOREIGN KEY (round_name) REFERENCES round(name),
    UNIQUE (round_name, distance)
);


CREATE TABLE outdoor_classifications(
    round TEXT NOT NULL,
    gender TEXT NOT NULL,
    age_group TEXT NOT NULL,
    bow TEXT NOT NULL,
    third INTEGER,
    second INTEGER,
    first INTEGER,
    bm INTEGER,
    mbm INTEGER,
    gmbm INTEGER,
    PRIMARY KEY (round, gender, age_group, bow),
    FOREIGN KEY (round) REFERENCES round(name),
    FOREIGN KEY (gender) REFERENCES genders,
    FOREIGN KEY (age_group) REFERENCES age_groups,
    FOREIGN KEY (bow) REFERENCES bows
);













